import React, {useEffect, useState} from "react";
import { TopListCharacter } from '../../../global/Interfaces';

const CharacterInfo: React.FC<{ characterUrl: string }> = ({ characterUrl }) => {
    const [character, setCharacter] = useState<TopListCharacter | null>(null);

    const fetchCharacterData = async () => {
        try {
            const response = await fetch(characterUrl);
            const data = await response.json();
            setCharacter(data);
        } catch (error) {
            console.error('Error fetching character:', error);
        }
    };

    useEffect(() => {
        void fetchCharacterData();
    }, [characterUrl]);

    return (
        <span>{`Dimension: ${character?.origin.name}`}</span>
    );
};

export default CharacterInfo;
